import React from 'react'
import Room from '../Room'
import style from './index.module.css'

const RoomList = ({ rooms, onRemove, onSelect }) => (
  <ul className={style.component}>
    {rooms.length > 0 ? (
        rooms
          .map(room => Room({
             room, onRemove, onSelect
           }))
    ) : ( null )}
  </ul>
)

export default RoomList
